import React from 'react';
import { 
    Card, 
    CardImg,  
    CardBody, 
    Col, 
    CardTitle,
    CardText
  } from 'reactstrap';

function CardLayout(props){

  return(
    <Col xs="2">

        {/* {(props.props.category_title)}  World */}

      <Card>
        <CardImg top width="100%" src alt={props.alt} />
        <CardBody>
            <CardTitle>{props.props.title}</CardTitle>
            {/* <CardSubtitle>Card subtitle</CardSubtitle> */}
            <CardText>
            <a href={props.topNews.link}>
              {props.text}
            </a>
          </CardText> 
        </CardBody>
      </Card>
    </Col>
  )
}
export default CardLayout;
